using namespace std;
class Solution {
public:
    vector<int> resultArray(vector<int>& nums) {
        int n=nums.size();
        vector<int> res;
        if(n%2==0) {
            for(int i=1; i<n; i+=2) {
                res.push_back(nums[i]);
            }
        }
        else {
            for(int i=1; i<n-1; i+=2) {
                res.push_back(nums[i]);
            }
            res.push_back(nums[n-1]);
        }
        return res;
    }
};
int main(){
    Solution s;
    vector<int> nums={5, 14, 3, 1, 2};
    vector<int> res = s.resultArray(nums);
    for(auto x: res) {
        cout<<x<<" ";
    }
    cout<<endl;
    return 0;
}

